import React, {useEffect, useState} from "react";
import Layout from "./Layout";
import axios from "axios";
import {a, b , c} from "./CreateBlog"


// Pass an empty array to ensure that the effect runs only once

export default function Home() {
  const [values, setValues] = useState([]);
  useEffect(() => {
    async function fetchValues() {
       // Fetch values from the server
       const response = await axios.get("https://localhost:5000:/Create");
       setValues(prevValues => [...prevValues, response.data]);
    }

    fetchValues();
   }, []); 
 return (
    <Layout>
      <>
        <div >
           <h1> {a} </h1>
           <h4> {b}</h4>
           <p> {c}</p>
        </div>
      </>
    </Layout>
 );
}
